import React, { useEffect } from 'react'
import { connect } from 'react-redux';
import { getBannerAction, getDailyRecommendListAction } from '../../../Redux/homePageAction';
import Carousel from '../../Carousel'
import Column from '../../Column';

function HomePage(props) {
  useEffect(()=>{
    props.getBanner();
    props.get
  },[])
  return (
    <div>HomePage
      <Carousel banners={props.banners}/>
      <Column title="推荐">
        
      </Column>
    </div>
  )
}

export default connect(
  state=>({
    banners:state.home.banners,
    getDailyRecommendList:state.home.da
  }),
  {
    getBanner:getBannerAction,
    getDailyRecommendList:getDailyRecommendListAction
  }
)(HomePage)
